// src/components/Home.js
import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <img
        src="/images/event-1.jpg"
        alt="Home Slide"
        style={{ width: "100%" }}
      />
      <p>
        Ready to test your knowledge? <Link to="/quiz">Start the Quiz</Link>
      </p>
    </div>
  );
}

export default Home;
